uld be Rick’s last album to be produced by British songwriting royalty – Stock, Aitken and Waterman. Six of the ten songs featured on this album were original compositions written and co-produced by Rick himself, its hits singles include ‘She Wants To Dance With Me’, the SAW-penned ‘Take Me To Your Heart’ and title track ‘Hold Me In Your Arms’. The LP reissue format features the remastered classic album pressed on striking blue vinyl and expertly recreated original artwork. The new double CD reissue features 28 tracks including the remastered original album plus b-sides, remixes and Rick’s own reimagined versions of the original singles from the album. The double CD also comes with an expanded booklet that includes previously unseen photographs of Rick from 1988/1989. Rick Astley store / shop.","thumbnail":{"thumbnails":[{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcTGHQXHU0wvDgD7MsIFsxuenbjfCR3HSpz5-ca3Kk6W4zixbINaNBPPVVPSPCrusLdd41ERFgD3","width":128,"height":128},{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcQVlk8x_Q22o9UZhG9KTkMfeYtihVmJUExB8Yq_KeyiiYwhMmhI9cakFb889y89rXLC7rGe33RG","width":256,"height":256},{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcTZBnE1CcTlc5gsW47nFUABKWAiZe7uk6X9xT7w2Nog8_u5VqptJvx-aX8vV9Q3cLS4DTv6Cd-8","width":512,"height":512}]},"price":"17,74 €","vendorName":"Merchbar","trackingParams":"COwBEJP0ARgEIhMIwZLHuv78_QIVB4F8Ch32bwLk","buttonText":"Acquista","buttonCommand":{"clickTrackingParams":"COwBEJP0ARgEIhMIwZLHuv78_QIVB4F8Ch32bwLk","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=product_shelf\u0026redir_token=QUFFLUhqbHRIZGdvcGZLNVc4V0V4TExFTzhQWlUxc0dYUXxBQ3Jtc0tsV29VY0c3bnlqbDc5cEFsbGJtTUlPc0l5Z2liQVdhcmlvUGpNREJ1aDlVd1hnQXdLRElQalZXdEd5aWdyZl9MaEVldzM3WkVxeUhJTzYxb2x4ckRxM1pmRjZDdUY4Z1RoZHRsVElIS0lsZlJ3ZWVLMA\u0026q=https%3A%2F%2Fwww.merchbar.com%2Fpop%2Frick-astley%2Frick-astley-hold-me-in-your-arms-2023-remaster-double-cd-album-cd%3Fucc%3D