rack ‘Every One of Us’ is a brand new song that shows that the power of Rick Astley 2.0 is undiminished. And it closes with a new ‘Pianoforte’ take on ‘Never Gonna Give You Up’. Dropping the peppy ‘80s beats for an intimate piano arrangement captures it in a new light, its inner heartbreak becoming all the more apparent. Echoing that spirit of reinvention, Rick recorded a set of ‘Reimagined’ acoustic interpretations of his songs, old and new, for the second disc of ‘The Best of Me’. Rick Astley store / shop.","thumbnail":{"thumbnails":[{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcSMtyYqwZKiNH-d3pZspeU_h53Ehe28TJ9-OsEEiE4WzjvCAJz2jPTW0gLuKz3rR4QQkljwlgCk","width":128,"height":128},{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcRiPcNQizohSzeFqIOnbaWzVAyDZ-hm6xYTkNfvb1xYyFFW3sp7DVebKpDCrp-GR2YrL6wAgCQM","width":256,"height":256},{"url":"https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcQIt4IVxoGQW9JWcHJJdoAWXUI5k02hqqp6hXCIA7g5VVh_J9Qhou5QOuDVu1_-2M5lUevHoPAZ","width":512,"height":512}]},"price":"26,45 €","vendorName":"Merchbar","trackingParams":"COQBEJP0ARgMIhMIwZLHuv78_QIVB4F8Ch32bwLk","buttonText":"Acquista","buttonCommand":{"clickTrackingParams":"COQBEJP0ARgMIhMIwZLHuv78_QIVB4F8Ch32bwLk","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=product_shelf\u0026redir_token=QUFFLUhqbG1UY1UtVENIaWxxNUhUa3I3Qkt6M3luM1FaUXxBQ3Jtc0tsNU9TREFuSTZneV85TXFzWjZ0LTlfQjhjVzFGSUZVblFWWXRVbWtsTkRJVDRXbEw4TDUtSnJlbVQ2eHRqUHJ2Tm95Y3hkZHQ4dS1uWlktQXV3V0Q4ZV9nZld0dHM3elpjZEx2XzdxakM0VFdlNVVYVQ\u0026q=https%3A%2F%2Fwww.merchbar.com%2Fpop%2Frick-astley%2Frick-astley-the-best-of-me-deluxe-2-disc-cd%3Fucc%3DIT%26ucl%3DIT%26srsltid%3DAfAwrE5i4OSj9ZVWBKfqpnBdtVil9DhC2vfYqESDFnDHZ5mxezkh8t8jrBM%26utm_term%3DUCuAXFkgsw1L7xaCfnd5JJOw%26utm_medium%3Dproduct_shelf%26utm_source%3Dyoutube%26utm_content%3DYT-ACHptLzAeY3BZydTwciLYK7af2Xv7YGkYN0dSE90Z8LovOcuQuY3TVMS8iq5tNpulahjSuR1Sw1Ix0rRtnnXTKmGHABfLOdw1PipsC6xWKm1r2aSLmAXum