clxsI8zepppYL5x1agIPGfRdXFm5fPEewDsRRWg4x6P6fdKNhj84GoUpUI4=s88-c-k-c0x00ffffff-no-nd-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Mostra altro"},"showLessText":{"simpleText":"Mostra meno"},"attributedDescriptionBodyText":{"content":"The official video for “Never Gonna Give You Up” by Rick Astley\nTaken from the album ‘Whenever You Need Somebody’ – deluxe 2CD and digital deluxe out 6th May 2022 Pre-order here – https://RickAstley.lnk.to/WYNS2022ID\n\n“Never Gonna Give You Up” was a global smash on its release in July 1987, topping the charts in 25 countries including Rick’s native UK and the US Billboard Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Rick’s debut LP “Whenever You Need Somebody”.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West – who later went on to make Hollywood blockbusters such as Con Air, Lara Croft – Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWe’re no strangers to love\nYou know the rules and so do I\nA full commitment’s what I’m thinking of\nYou wouldn’t get this from any other guy\n\nI just wanna tell you how I’m feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWe’ve known each other for so long\nYour heart’s been aching but you’re too shy to say it\nInside we both know what’s been going on\nWe know the game and we’re gonna play it\n\nAnd if you ask me how I’m feeling\nDon’t tell me you’re too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAUiEwjBkse6_vz9AhUHgXwKHfZvAuRIxLuBrb2YjoZ1","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbFN1cVdoX0xpMVdzVHo2NF9VVkpEdWhrVnhVZ3xBQ3Jtc0tuUDhWSVZkemhDOHF1V2k3ZVQ3UXpZUmxuSlNPQW1maGprd0lOM1FXWTYzX3NJVWZOOGFnRkV3MmdXajBKUEdoaGlGZnZpRnhjaWszSjFzUTdrQUo2aTdWY1FmdVBleU50LWRQTFk5UmVKWmx1WlRtMA\u0026q=https%3A%2F%2FRickAstley.lnk.to%2FWYNS2022ID\u0026v=dQw4w9WgXcQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbFN1cVdoX0xpMVdzVHo2NF9VVkpEdWhrVnhVZ3xBQ3Jtc0tuUDhWSVZkemhDOHF1V2k3ZVQ3UXpZUmxuSlNPQW1maGprd0lOM1FXWTYzX3NJVWZOOGFnRkV3MmdXajBKUEdoaGlGZnZpRnhjaWszSjFzUTdrQUo2aTdWY1FmdVBleU50LWRQTFk5UmVKWmx1WlRtMA\u0026q=https%3A%2F%2FRickAstley.lnk.to%2FWYNS2022ID\u0026v=dQw4w9WgXcQ","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":971,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAUiEwjBkse6_vz9AhUHgXwKHfZvAuRIxLuBrb2YjoZ1","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa2gybEZHeHNGelQ